import { Menu, Button } from 'antd';
import {
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  GlobalOutlined,
  BarsOutlined,
  QrcodeOutlined,
  UserOutlined
} from '@ant-design/icons';
import { useState, useEffect } from 'react';
const { SubMenu } = Menu;

const axios = require('axios')

const content = {
  marginTop: '100px',
}

export default function Home() {
  // axios.get('http://numbersapi.com/42')
  // .then(function (response) {
  //   // handle success
  //   console.log(response);
  // })
  // .catch(function (error) {
  //   // handle error
  //   console.log(error); 
  // })
  // .then(function () {
  //   // always executed
  // });
  const [state, setState] = useState({collapsed: false});

  useEffect(()=>{
    console.log(state);
  },[state]);
  return (
    <div>
      <Button type="primary" onClick={()=>setState({collapsed:!state.collapsed})}>
        {React.createElement(state.collapsed ? MenuUnfoldOutlined : MenuFoldOutlined)}
      </Button>
      <Menu
        className={state.collapsed ? "menu_folded" : "menu_unfolded"}
        defaultSelectedKeys={['1']}
        defaultOpenKeys={['sub1']}
        mode="inline"
        theme="dark"
        inlineCollapsed={state.collapsed}
      >
        <Menu.Item key="1" icon={<GlobalOutlined style={{fontSize:"1.3rem", paddingLeft:"0px"}}/>} className="menu_item_size">
          Map
        </Menu.Item>
        <Menu.Item key="2" icon={<BarsOutlined />}>
          List
        </Menu.Item>
        <Menu.Item key="3" icon={<QrcodeOutlined />}>
          QR
        </Menu.Item>

        <SubMenu key="sub1" icon={<UserOutlined />} title="Navigation One">
          <Menu.Item key="5">Option 5</Menu.Item>
          <Menu.Item key="6">Option 6</Menu.Item>
          <Menu.Item key="7">Option 7</Menu.Item>
          <Menu.Item key="8">Option 8</Menu.Item>
        </SubMenu>
      </Menu>
    </div>
  );
}
